  List<Map<String, dynamic>> _foundUsers = [];

  @override
  initState() {
    // at the beginning, all users are shown
    _foundUsers = _allUsers;
    super.initState();
  }

  void _runFilter(String enteredKeyword) {
    List<Map<String, dynamic>> results = [];
    List<Map<String, dynamic>> results1 = [];
    if (enteredKeyword.isEmpty) {
      // if the search field is empty or only contains white-space, we'll display all users
      results = _allUsers;
    } else {
      results = _allUsers
          .where((user) =>
          user["name"].toLowerCase().contains(enteredKeyword.toLowerCase()))
          .toList();
      results1 = _allUsers
          .where((user) =>
          user["id"].toString().contains(enteredKeyword.toLowerCase()))
          .toList();

      // we use the toLowerCase() method to make it case-insensitive
    }

    // Refresh the UI
    setState(() {
      _foundUsers = results + results1;
    });
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: const Text('MOH CODE ==>NUPCO CODE'),
      ),
      body: Padding(
        padding: const EdgeInsets.all(10),
        child: Column(
          children: [
            Text('${_foundUsers.length.toString()}',
              style: TextStyle(color: Colors.orange),),
            const SizedBox(
              height: 20,
            ),
            TextField(
              onChanged: (value) => _runFilter(value),
              decoration: const InputDecoration(
                  labelText: 'البحث', suffixIcon: Icon(Icons.search)),
            ),
            const SizedBox(
              height: 20,
            ),
            Expanded(
              child: _foundUsers.isNotEmpty
                  ? ListView.builder(
                itemCount: _foundUsers.length,
                itemBuilder: (context, index) =>
                    Card(
                      // key: ValueKey(_foundUsers[index]["id"]),
                      color: Colors.black,
                      elevation: 4,
                      margin: const EdgeInsets.symmetric(vertical: 12),
                      child: ListTile(


                        leading: Text(
                          _foundUsers[index]["id"].toString(),
                          style: const TextStyle(fontSize: 24),
                        ),
                        title: Text(_foundUsers[index]['id2'].toString()),
                            //  tileColor: Colors.lightGreenAccent,

                        subtitle: Text(
                            '${_foundUsers[index]["name"].toString() +"==>STORE"+
                                _foundUsers[index]["store"].toString()} '),

                      ),

                    ),
              )
                  : const Text(
                'No results found',
                style: TextStyle(fontSize: 24),
              ),
            ),
          ],
        ),
      ),
    );
  }
